import React from "react";
import ReactDom from "react-dom";

//CSS
import "./index.css";
function JobList() {
  return (
    <section className="jobInstance">
      {" "}
      <JobInstance /> <JobInstance />
      <JobInstance />
      <JobInstance />{" "}
    </section>
  );
}
const JobInstance = () => {
  return (
    <article className="job_box">
      <Logo />
      <PositionTitle />
      <Tags />

      <CompanyName />
    </article>
  );
};
const Logo = () => (
  <img
    className="logo"
    src="https://images.theconversation.com/files/93616/original/image-20150902-6700-t2axrz.jpg?ixlib=rb-1.1.0&q=45&auto=format&w=1000&fit=clip"
    alt=""
  />
);
const PositionTitle = () => <h2 className="position_name">Position Title</h2>;
const CompanyName = () => <p className="company_name">Company Name(c)</p>;
const Tags = () => (
  <div className="tags">
    <span>Tags here</span> <span>Tags here</span> <span>Tags here</span>
  </div>
);
const Location = () => <p className="location">Location</p>;
ReactDom.render(<JobList />, document.getElementById("root"));
